const nombre = 'paul';
const apellido = 'salazar';

const nombreCompleto = nombre + ' ' + apellido;

const compelto = `${nombre} ${apellido}`;
console.log(nombreCompleto);

console.log(compelto);


function getSaludo(){
    return 'Hola';
}

console.log(`Este es un mensaje: ${getSaludo()}`);
